import React from "react";
import { GStockContainer, Wrapper } from "./GstockElements.js";
const Gstock = () => {
  return (
    <div>
      <Wrapper>
        <GStockContainer>
          <table>
            <tr>
              <th>Produit</th>
              <th>id</th>
              <th>image</th>
              <th>hello</th>
              <th>world</th>
            </tr>
          </table>
        </GStockContainer>
      </Wrapper>
    </div>
  );
};

export default Gstock;
